import React from 'react';
import './App.css';
import NavBar from '../NavBar';

function Joel() {
  return (
    <div>
      <h1>Joel</h1>
    </div>
  );
}

function Home() {
  return (
    <div>
      <NavBar />
      <Joel />
    </div>
  );
}

export default Home;
